import React from 'react'

export const LatestJob = () => {
    return (
        <div className=' container mx-auto px-4 my-5'>
            <ul class="lcp_catlist" id="lcp_instance_0">
            <li><a href="https://onlineupdatestm.in/indian-army-agniveer-online-form-2022/" target="_blank">Indian Army Agniveer Online Form 2022- Eligibility Criteria Documents Fee</a></li>
            <li><a href="https://onlineupdatestm.in/indian-navy-agniveer-online-form-2022/" target="_blank">Indian Navy Agniveer Online Form 2022- Eligibility Criteria Documents, Fee</a></li><li><a href="https://onlineupdatestm.in/ibps-clerk-recruitment-2022-online-form-2022/" target="_blank">IBPS Clerk Recruitment 2022 Online Form 2022-Eligibility Criteria,Documents,Fee</a></li>
            <li><a href="https://onlineupdatestm.in/patna-civil-court-group-c-vaccancy-2022/" target="_blank">Patna Civil Court Group C Vaccancy 2022-पटना सिविल कोर्ट भर्ती प्रक्रिया</a></li><li><a href="https://onlineupdatestm.in/integral-coach-factory-apprentice-online-form-2022/" target="_blank">Integral Coach Factory Apprentice Online Form 2022 (10th pass)</a></li><li><a href="https://onlineupdatestm.in/delhi-police-constable-driver-online-form-2022/" target="_blank">Delhi Police Constable Driver Online Form 2022- Eligibility,Criteria,Document,Fee</a></li><li><a href="https://onlineupdatestm.in/bihar-vikas-mitra-vacancy-2022/" target="_blank">Bihar Vikas Mitra Vacancy 2022- बिहार विकास मित्र बहाली 2022 जानें पुरी जानकारी</a></li><li><a href="https://onlineupdatestm.in/bihar-social-welfare-recruitment-2022/" target="_blank">Bihar Social Welfare Recruitment 2022-बिहार समाज कल्याण विभाग भर्ती ऑनलाइन आवेदन शुरू</a></li><li><a href="https://onlineupdatestm.in/indian-air-force-agniveer-vacancy-2022/" target="_blank">Indian Air Force Agniveer Vacancy 2022- Online Apply, Eligibility, Documents &amp; Other Details</a></li><li><a href="https://onlineupdatestm.in/bihar-anganwadi-sahayika-sevika-bahali-2022-2/" target="_blank">Bihar Anganwadi Sahayika/Sevika Bahali 2022 | सहायिका/सेविका बहाली 8वी पास जल्दी करें आवेदन</a></li><li><a href="https://onlineupdatestm.in/rail-kaushal-vikas-yojana-online-form-2022/" target="_blank">Rail Kaushal Vikas Yojana Online Form 2022-रेल कौशल विकास योजना 2022: Eligibility Criteria, Documents</a></li><li><a href="https://onlineupdatestm.in/bihar-ration-dealer-bharti-2022/" target="_blank">Bihar Ration Dealer Bharti 2022-बिहार राशन डीलर भर्ती 2022</a></li><li><a href="https://onlineupdatestm.in/bihar-computer-operater-vacancy-2022/" target="_blank">Bihar Computer Operater Vacancy 2022-बिहार कंप्यूटर ऑपरेटर बहाली 2022 जल्दी करें आवेदन</a></li><li><a href="https://onlineupdatestm.in/assam-rifles-tradesman-railley-2022/" target="_blank">Assam Rifles Tradesman Railley 2022</a></li><li><a href="https://onlineupdatestm.in/munger-university-ug-admission-2022-bab-scb-com-admission-process-2022-25/" target="_blank">Munger University UG Admission 2022-BA,B.Sc,B.Com Admission Process 2022-25</a></li></ul>
        </div>
    )
}
